:root {
  --transition-speed: 0.3s ease;
}

[data-theme="light"] {
  --bg-color: #ffffff;
  --text-color: #333333;
  --primary: #3498db;
  --secondary: #2ecc71;
  --shadow: rgba(0,0,0,0.1);
}

[data-theme="dark"] {
  --bg-color: #1a1a1a;
  --text-color: #ffffff;
  --primary: #2980b9;
  --secondary: #27ae60;
  --shadow: rgba(255,255,255,0.1);
}

* {
  margin: 0;
  padding: 0;
  box-sizing: border-box;
}

body {
  font-family: 'Arial', sans-serif;
  background-color: var(--bg-color);
  color: var(--text-color);
  min-height: 100vh;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  transition: background-color var(--transition-speed), color var(--transition-speed);
  padding: 1rem;
}

.container {
  text-align: center;
  max-width: 800px;
  width: 100%;
}

h1 {
  font-size: 3rem;
  color: var(--primary);
  margin-bottom: 1.5rem;
  transition: color var(--transition-speed);
  animation: fadeInUp 0.8s ease-in-out;
}

.theme-toggle {
  background: transparent;
  border: 2px solid var(--primary);
  color: var(--primary);
  padding: 0.75rem 1.5rem;
  border-radius: 25px;
  font-size: 1rem;
  cursor: pointer;
  transition: all var(--transition-speed);
  margin-top: 2rem;
}

.theme-toggle:hover {
  background-color: var(--primary);
  color: white;
  box-shadow: 0 4px 12px var(--shadow);
}

@keyframes fadeInUp {
  from {
    opacity: 0;
    transform: translateY(-30px);
  }
  to {
    opacity: 1;
    transform: translateY(0);
  }
}

@media (max-width: 768px) {
  h1 {
    font-size: 2.2rem;
  }

  .theme-toggle {
    padding: 0.6rem 1.2rem;
    font-size: 0.9rem;
  }
}

@media (max-width: 480px) {
  h1 {
    font-size: 1.8rem;
  }

  .theme-toggle {
    padding: 0.5rem 1rem;
    font-size: 0.85rem;
  }
}

document.addEventListener('DOMContentLoaded', () => {
  // 获取DOM元素
  const hamburger = document.querySelector('.hamburger');
  const navMenu = document.querySelector('.nav-menu');
  const darkModeToggle = document.querySelector('#dark-mode-toggle');
  const scrollLinks = document.querySelectorAll('a[href^="#"]');

  // 响应式导航切换
  const toggleNav = () => {
    navMenu.classList.toggle('active');
    hamburger.classList.toggle('active');
  };

  hamburger?.addEventListener('click', toggleNav);

  // 窗口 resize 处理
  const handleResize = () => {
    if (window.innerWidth >= 768) {
      navMenu.classList.remove('active');
      hamburger.classList.remove('active');
    }
  };

  window.addEventListener('resize', handleResize);

  // 平滑滚动
  scrollLinks.forEach(link => {
    link.addEventListener('click', (e) => {
      e.preventDefault();
      const targetId = link.getAttribute('href');
      const target = document.querySelector(targetId);

      if (target) {
        target.scrollIntoView({
          behavior: 'smooth',
          block: 'nearest'
        });

        // 移动端关闭菜单
        if (window.innerWidth < 768) toggleNav();
      }
    });
  });

  // 深色模式处理
  const DARK_MODE_KEY = 'darkMode';

  const setDarkMode = (isEnabled) => {
    document.body.classList.toggle('dark-mode', isEnabled);
    localStorage.setItem(DARK_MODE_KEY, isEnabled ? 'true' : 'false');
  };

  // 初始化深色模式（优先本地存储，其次系统偏好）
  const savedDarkMode = localStorage.getItem(DARK_MODE_KEY);
  const prefersDark = window.matchMedia('(prefers-color-scheme: dark)').matches;
  const initialDarkMode = savedDarkMode !== null ? savedDarkMode === 'true' : prefersDark;

  setDarkMode(initialDarkMode);

  // 切换深色模式
  darkModeToggle?.addEventListener('click', () => {
    setDarkMode(!document.body.classList.contains('dark-mode'));
  });
});

